    <style>
        div{
            height: 155px;
            width: 630px;
            border: 1px black solid;
            margin-left: 360px;
            background: linear-gradient(#485563,#29323c);
        }
        
      
        img{
            align-content: center;
            width: 150px;
            height: 150px;
            border: 2px black solid;
        }
        img:hover{
            border-radius: 50%;
            border: 1px black solid;
            box-shadow: 5px 5px 8px black;
        }
        
        h1 {
            position: relative;
            margin-left: 180px;
            bottom: 60px;
            z-index: -1;

        }

        div:hover h1 {
            transform: translateY(50px);
            
        }
        .one{
            margin-top: 50px;
        }
        .two{
            border-radius: 50%;
        }
        .two:hover{
            border: 1px black solid;
            box-shadow: 5px 5px 8px rgb(10, 44, 131);
            border-top-left-radius: 45deg;
            border-top-right-radius: 45deg;
            clip-path: polygon(50% 0%, 0% 100%, 100% 100%);
        }
        h2 {
            position: relative;
            margin-left: 80px;
            bottom: 110px;
            z-index: -1;
            text-align: center;

        }
        .one:hover h2{
            transform: translateY(100px);
            
        }
        
    </style>
